import React from 'react';
import { Link } from 'react-router-dom';
import './buttonPurchase.css';

export default function ButtonPurchase() {
    const cleaner = () => {
        document.location = '/purchase'
    }

    return (
        <div className='button'>
            <Link to="/purchase">
                <button
                    onClick={cleaner}
                    disabled>
                    Purchase
                </button>
            </Link>
        </div>

    )
}
